import React from "react";
import { Link } from "react-router-dom"

const Repositories = props => (
    <React.Fragment>
    { props.repositories.map((repository , index) => {
        return (
            <React.Fragment key= { index }>
                <p> { repository.name }</p>
                <button>
                    <Link to={{ pathname: `/repository/`, state: { commits: `${repository.commits_url}`} }}>See</Link>
                </button>
                <a href= { repository.html_url } >See on Github</a>
            </React.Fragment>
        )
    })
    }
    </React.Fragment>
)


export default Repositories
